import React from "react";
import "./BottomNav.css";
import { Home, Search, PlusCircle, Bell, User } from "lucide-react";

export default function BottomNav() {
  return (
    <div className="bottom-nav">
      <div className="nav-item"><Home size={24} /></div>
      <div className="nav-item"><Search size={24} /></div>
      <div className="nav-item center-item"><PlusCircle size={28} /></div>
      <div className="nav-item"><Bell size={24} /></div>
      <div className="nav-item"><User size={24} /></div>
    </div>
  );
}
